import React from "react";
// import InstagramEmbed from 'react-instagram-embed';



function Home() {


    return (
      <div >
        <h1>Welcome Home</h1>
        <div>
            <h1>My Instagram Profile</h1>
                <iframe
                    src="https://www.instagram.com/chicagofightteam/"
                    width="320"
                    height="400"
                    frameborder="0"
                    scrolling="no"
                    allowtransparency="true"
                ></iframe>
            </div>
       </div>
    );
  }

export default Home;
